<template>
<div class="form-attachment">
    <slot name="title"></slot>
    <div class="tmp-form-item-content">
        <ul v-if="valueConfig[PARAM_COMMON_VALUE_CODE].length" class="attachment-list">
            <li v-for="(attachment, index) in valueConfig[PARAM_COMMON_VALUE_CODE]" :key="index" class="attachment-list-content">
                <div class="attachment-name">
                    <img class="attachment-type" :src="imageMap[getFileType(attachment.relativePath)]" />
                    <div class="attachment-title">
                        <nari-tooltip :value="getAttaName(attachment.relativePath)" />
                    </div>
                </div>
                <div class="attachment-operation">
                    <router-link class="text-primary check-resume" target="_blank" :to="`/api/common/file/preview.json?ossPath=${attachment.relativePath.split('||')[1]}`">
                        <div class="icon-wrapper">
                            <svg-icon icon-class="file-view"></svg-icon>
                        </div>
                    </router-link>
                </div>
            </li>
        </ul>
        <template v-else>
            暂无附件
        </template>
    </div>
</div>
</template>
<script>
import { getIconName, getFileType } from '@noah/tools/src/utils/icon.js';
import Mixin from '@/package/template-center/components/layout/mixins/preview.js';

export default {
    name: 'AttachmentView',
    mixins: [Mixin],
    data() {
        return {
            imageMap: {
                image: 'data:image/svg+xml;base64,',
                pdf:'data:image/svg+xml;base64,',
                ppt: 'data:image/svg+xml;base64,',
                excel: 'data:image/svg+xml;base64,',
                word: 'data:image/svg+xml;base64,',
                video: 'data:image/svg+xml;base64,',
                other: 'data:image/svg+xml;base64,'
            }
        };
    },
    computed: {
    },
    created() {
        this.getIconName = getIconName;
        this.getFileType = getFileType;
    },
    mounted() {
    },
    methods: {
        /**
         * @description: 获取附件名防范
         * @param {String} attachment 附件全称
         * @return {String} 附件名
         */
        getAttaName(attachment) {
            if (!attachment) { return '';}
            return attachment.split('||')[0];
        }
    }
};
</script>
